/// biography : "{\"oz\":\"<p data-pm-slice=\\\"1 1 []\\\">G.Abduvoxidova &ndash; 1971 yil Andijon viloyatida tug&lsquo;ilgan. Maʼlumoti oliy, mutaxassisligi huquqshunos, harbiy (maxsus) unvoni podpolkovnik<\\/p>\\r\\n<p>1996&ndash;2002 yillarda Andijon viloyati IIB huzuridagi Qo&lsquo;riqlash bo&lsquo;linmasida militsiya batalyoni militsioneri, 2002&ndash;2010 yillarda Andijon shahar IIB HOOB voyaga yetmaganlar va yoshlar orasida xuquqbuzarliklarni oldini olish bo&lsquo;linmasi inspektori va katta inspektori, 2010-2017 yillarda Andijon viloyati IIB Huquqbuzarliklarni oldini olish boshqarmasi inspektori va katta inspektori, 2017&ndash;2018 yillarda Andijon viloyati IIB Huquqbuzarliklar profilaktikasi boshqarmasi boshlig&lsquo;ining o&lsquo;rinbosari-ozodlikdan mahrum etish bilan bog&lsquo;liq bo&lsquo;lmagan jazolarni ijro etilishini nazorat qilish bo&lsquo;linmasi boshlig&lsquo;i, 2018&ndash;2019 yillarda Andijon viloyati IIB Huquqbuzarliklar profilaktikasi boshqarmasi katta inspektori, 2019&ndash;2022 yillarda Andijon viloyati IIB Huquqbuzarliklar profilaktikasi boshqarmasi boshlig&lsquo;i o&lsquo;rinbosari- Xotin qizlar masalalari bo&lsquo;yicha bo&lsquo;lim boshlig&lsquo;i lavozimlarida faoliyat yuritgan.<\\/p>\\r\\n<p>2022 yil 20 oktyabrdan eʼtiboran Oliy Majlisning Inson huquqlari bo&lsquo;yicha vakilining (ombudsmanning) Andijon viloyati mintaqaviy vakili lavozimida ishlamoqda<\\/p>\",\"uz\":\"<p><span lang=\\\"UZ-CYR\\\">Г.Абдувохидова &ndash; 1971 йил Андижон вилоятида туғилган. Маълумоти олий, мутахассислиги ҳуқуқшунос, ҳарбий (махсус) унвони подполковник <\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">1996&ndash;2002 йилларда Андижон вилояти ИИБ ҳузуридаги Қўриқлаш бўлинмасида милиция батальони милиционери, 2002&ndash;2010 йилларда Андижон шаҳар ИИБ ҲООБ вояга етмаганлар ва ёшлар орасида хуқуқбузарликларни олдини олиш бўлинмаси инспектори ва катта инспектори, 2010-2017 йилларда Андижон вилояти ИИБ Ҳуқуқбузарликларни олдини олиш бошқармаси инспектори ва катта инспектори, 2017&ndash;2018 йилларда Андижон вилояти ИИБ Ҳуқуқбузарликлар профилактикаси бошқармаси бошлиғининг ўринбосари-озодликдан маҳрум этиш билан боғлиқ бўлмаган жазоларни ижро этилишини назорат қилиш бўлинмаси бошлиғи, 2018&ndash;2019 йилларда Андижон вилояти ИИБ Ҳуқуқбузарликлар профилактикаси бошқармаси катта инспектори, 2019&ndash;2022 йилларда Андижон вилояти ИИБ Ҳуқуқбузарликлар профилактикаси бошқармаси бошлиғи ўринбосари- Хотин қизлар масалалари бўйича бўлим бошлиғи лавозимларида фаолият юритган. <\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">2022 йил 20 октябрдан эътиборан Олий Мажлиснинг Инсон ҳуқуқлари бўйича вакилининг (омбудсманнинг) Андижон вилояти минтақавий вакили лавозимида ишламоқда<\\/span><\\/p>\",\"ru\":\"<p><span lang=\\\"UZ-CYR\\\">Г.Абдувохидова - родилась в 1971 году в Андижанской области. Образование высшее, специальность юрист, воинское (специальное) звание подполковник<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">В 1996-2002 годах была милиционером батальона милиции Отдела охраны при УВД Андижанской области, в 2002-2010 годах инспектором и старшим инспектором отдела профилактики правонарушений среди несовершеннолетних и молодежи УВД Андижанской области. г., в 2010-2017 годах инспектор и старший инспектор отдела профилактики правонарушений УВД Андижанской области инспектор, в 2017-2018 годах заместитель начальника отдела профилактики правонарушений УВД Андижанской области - начальник отдела по контролю за исполнением наказаний, не связанных с лишением свободы, в 2018-2019 годах старший инспектор Управления по профилактике правонарушений УВД Андижанской области, в 2019-2022 годах В УВД Андижанской области работал в должностях заместителя начальника отдела профилактики &ndash; начальника отдела по делам женщин.<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">С 20 октября 2022 года работает Региональным представителем Уполномоченного Олий Мажлиса по правам человека (Омбудсмана) в Андижанской области.<\\/span><\\/p>\",\"en\":\"<p><span lang=\\\"UZ-CYR\\\">G. Abduvohidova - was born in 1971 in the Andijan region. Higher education, profession lawyer, military (special) rank of lieutenant colonel<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">In 1996-2002 she was a police officer of the police battalion of the Security Department at the Internal Affairs Directorate of Andijan region, in 2002-2010 she was an inspector and senior inspector of the department for the prevention of delinquency among minors and youth of the Internal Affairs Directorate of Andijan region. 2010-2017 Inspector and Senior Inspector of the Crime Prevention Department of the Internal Affairs Directorate of Andijan Region Inspector, in 2017-2018 Deputy Head of the Crime Prevention Department of the Internal Affairs Directorate of Andijan Region - Head of the Department for Control over the Execution of Non-custodial Sentences, in 2018 -2019 Senior Inspector of the Crime Prevention Department of the Internal Affairs Directorate of Andijan Region, in 2019-2022, in the Department of Internal Affairs of Andijan Region, he worked as Deputy Head of the Prevention Department - Head of the Women's Affairs Department.<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">Since October 20, 2022, he has been working as the Regional Representative of the Authorized Person of the Oliy Majlis for Human Rights (Ombudsman) in Andijan region.<\\/span><\\/p>\"}"
/// content : "{\"oz\":\"<p data-pm-slice=\\\"1 1 []\\\">- hududlarda inson huquqlari, erkinliklari va qonuniy manfaatlariga rioya etilishini taʼminlash, inson huquqlari monitoringini tashkil etish va o&lsquo;tkazish;<\\/p>\\r\\n<p>- fuqarolarning shikoyatlarini qabul qilish va ko&lsquo;rib chiqish, ularning buzilgan huquqlarini tiklashda ko&lsquo;maklashish;<\\/p>\\r\\n<p>- o&lsquo;z tashabbusi bilan yoki murojaat muallifining iltimosiga ko&lsquo;ra, murojaatni ekspertlar, mutaxassislar va manfaatdor tashkilotlar vakillarining ishtirokida ko&lsquo;rib chiqishni tashkil qilish;<\\/p>\\r\\n<p>- ushlab turilgan, qamoqqa olingan, maʼmuriy jazo o&lsquo;tayotgan va ozodlikdan mahrum qilingan shaxslar bilan uchrashuv va suhbatlar o&lsquo;tkazish;<\\/p>\\r\\n<p>- inson huquqlari, erkinliklari va qonuniy manfaatlariga rioya qilish va ularni himoya qilish sohasidagi axborot-maʼrifiy ishlarni mahalliy davlat hokimiyati organlari, ommaviy axborot vositalari vakillari va fuqarolik jamiyatining boshqa institutlari bilan birgalikda amalga oshirish<\\/p>\",\"uz\":\"<p><span lang=\\\"UZ-CYR\\\">- ҳудудларда инсон ҳуқуқлари, эркинликлари ва қонуний манфаатларига риоя этилишини таъминлаш, инсон ҳуқуқлари мониторингини ташкил этиш ва ўтказиш;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">- фуқароларнинг шикоятларини қабул қилиш ва кўриб чиқиш, уларнинг бузилган ҳуқуқларини тиклашда кўмаклашиш;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">- ўз ташаббуси билан ёки мурожаат муаллифининг илтимосига кўра, мурожаатни экспертлар, мутахассислар ва манфаатдор ташкилотлар вакилларининг иштирокида кўриб чиқишни ташкил қилиш;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">- ушлаб турилган, қамоққа олинган, маъмурий жазо ўтаётган ва озодликдан маҳрум қилинган шахслар билан учрашув ва суҳбатлар ўтказиш;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">- инсон ҳуқуқлари, эркинликлари ва қонуний манфаатларига риоя қилиш ва уларни ҳимоя қилиш соҳасидаги ахборот-маърифий ишларни маҳаллий давлат ҳокимияти органлари, оммавий ахборот воситалари вакиллари ва фуқаролик жамиятининг бошқа институтлари билан биргаликда амалга ошириш<\\/span><\\/p>\",\"ru\":\"<p><span lang=\\\"UZ-CYR\\\">- обеспечение соблюдения прав, свобод и законных интересов человека в регионах, организация и проведение мониторинга соблюдения прав человека;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">&nbsp;<\\/span><span lang=\\\"UZ-CYR\\\">- прием и рассмотрение обращений граждан, содействие в восстановлении их нарушенных прав;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">&nbsp;<\\/span><span lang=\\\"UZ-CYR\\\">- по собственной инициативе или по требованию автора обращения организовать рассмотрение обращения с участием экспертов, специалистов и представителей заинтересованных организаций;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">&nbsp;<\\/span><span lang=\\\"UZ-CYR\\\">- встречи и беседы с задержанными, арестованными, задержанными в административном порядке и заключенными;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">&nbsp;<\\/span><span lang=\\\"UZ-CYR\\\">- Проведение информационно-просветительской работы в сфере соблюдения и защиты прав, свобод и законных интересов человека совместно с органами местного самоуправления, средствами массовой информации и другими институтами гражданского общества<\\/span><\\/p>\",\"en\":\"<p><span lang=\\\"UZ-CYR\\\">Ensuring observance of human rights, freedoms and legitimate interests in the regions, organizing monitoring of human rights observance;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">Reception and consideration of citizens' appeals, assistance in restoring their violated rights;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">On their own initiative or at the request of the author of the appeal, organize consideration of the appeal with the participation of experts, specialists and representatives of interested organizations;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">Meetings and conversations with detainees, arrested persons, administrative detainees and prisoners;<\\/span><\\/p>\\r\\n<p><span lang=\\\"UZ-CYR\\\">Carrying out information and educational work in the field of observance and protection of human rights, freedoms and legitimate interests together with local governments, the media and other institutions of civil society<\\/span><\\/p>\"}"
